어 음 진짜 배뎃 말대로 라면 스토리가 상당히 복잡해지네요.
살짝 생각을해보면 남주는 지금 악마와의 만남과 시간 되돌리는게 처음이니 아마 이후에 사귀는 것이 성공할듯합니다. 그후 사귄걸 후회한 여주가 악마를 만나 과거로 돌아가는거죠.그래서 바ㅡ로 철벽철벽 옹성을 쌓는겁니다. 시간적 순서로 봤을때 1.남주 과거 여행--2.사귀기 성공--3.여주 후회--4.여주 과거 여행(남주가 과거로 돌아온 시점으로 여행)--5.철 옹성을 짓는다.--6.계약한 악마가 같은악마이며 악마의 빅피쳐이다?

상당한 헛소리 지껄여 봤어요. 죄송....;;

